import React, {Component} from 'react';

class addUserForm extends Component{
	render(){
		return(
			<form onSubmit={this.handleSubmit}>
	            <input placeholder="enter in user name" type="text" />
	            <button> Add </button>
	         </form>
        )
	}
}

export default addUserForm;
